import React from 'react';
import Dropdown from 'react-bootstrap/Dropdown';

function DropCalendar(props) {
  return (
    <Dropdown>
        <Dropdown.Toogle variant="succes" id="dropdown-basic">
            Drop a Calendar
        </Dropdown.Toogle>

        <Dropdown.Menu>
            {props.children}
        </Dropdown.Menu>
    </Dropdown>
  )
}

export default Dropdown
